function Component() {
  return (
    <div>
      <h1>Meu nome é Fernando Lasmar</h1>

      <p>Sou Brasileiro nascido em Belo Horizonte, casado e tenho um filho de 4 anos de idade, meu hobby é jogar games no pc, passeio de moto e bike.</p>

    </div>
  );
}
export default Component;
